        { id: 2, name: "Victor Wayne" },
        { id: 3, name: "Jane Doe" },
      ];

      return (
        <>
          {conts.map((cont) => (
            <div className="user">{cont.id}</div>
          ))}
        </>
      );
    };

  export default Cont
